void GetSVGDocumentOperationCallback(const v8::FunctionCallbackInfo<v8::Value>& info)
{
    RUNTIME_CALL_TIMER_SCOPE_DISABLED_BY_DEFAULT(info.GetIsolate(), "Blink_HTMLIFrameElement_getSVGDocument");
    BLINK_BINDINGS_TRACE_EVENT("HTMLIFrameElement.getSVGDocument");

    // [CheckSecurity=ReturnValue]
    v8::Isolate* isolate = info.GetIsolate();
    v8::Local<v8::Context> current_context = isolate->GetCurrentContext();
    v8::Local<v8::Object> v8_receiver = info.This();
    HTMLIFrameElement* blink_receiver = V8HTMLIFrameElement::ToWrappableUnsafe(isolate, v8_receiver);
    ExceptionState exception_state(isolate);
    auto&& return_value = blink_receiver->getSVGDocument(exception_state);
    static_assert(bindings::IsReturnTypeCompatible<IDLNullable<Document>, std::remove_cvref_t<decltype(return_value)>>,
        "Return type from native call is incompatible to the type specified in IDL");
    if (exception_state.HadException()) [[unlikely]] {
        return;
    }
    if (!BindingSecurity::ShouldAllowAccessTo(ToLocalDOMWindow(current_context), return_value)) {
        ScriptState* current_script_state = ScriptState::From(isolate, current_context);
        ExecutionContext* current_execution_context = ToExecutionContext(current_script_state);
        UseCounter::Count(current_execution_context, WebFeature::kCrossOriginHTMLIFrameElementGetSVGDocument);
        bindings::V8SetReturnValue(info, nullptr);
        return;
    }
    {
        // [CheckSecurity=ReturnValue]
        Frame* blink_frame = blink_receiver->contentWindow()->GetFrame();
        DCHECK(IsA<LocalFrame>(blink_frame));
        ScriptState* receiver_script_state = ScriptState::ForRelevantRealm(isolate, v8_receiver);
        ScriptState* script_state = receiver_script_state;
        if (!blink_frame->IsAttached() && To<LocalFrame>(blink_frame)->WindowProxyMaybeUninitialized(script_state->World())->ContextIfInitialized().IsEmpty())
            [[unlikely]] {
            // Don't wrap the return value if its frame is in the process of detaching and
            // has already invalidated its v8::Context, as it is not safe to
            // re-initialize the v8::Context in that state. Return null instead.
            bindings::V8SetReturnValue(info, nullptr);
            return;
        }
        v8::Local<v8::Value> v8_value
            = ToV8Traits<IDLNullable<Document>>::ToV8(ToScriptState(To<LocalFrame>(blink_frame), script_state->World()), return_value);
        bindings::V8SetReturnValue(info, v8_value);
    }
}

